Spring Data MongoDB - Find millions of data with Pageable - Memory overload?<p>I am using Spring Data MongoDB and I have this simple repository:</p>
<pre><code>@Repository
public interface TracksRepository extends MongoRepository&lt;Track, String&gt; {

}
</code></pre>
<p>And I am fetching my tracks using <code>Pageable</code> like this <code>tracksRepository.findAll(PageRequest.of(0,100))</code></p>
<p>What will happen though if I have 100 million tracks for example?</p>
<p>Will all of them get loaded into memory (probably crushing my server) in order for them to get paged?</p>
<p>I am asking this because I saw that SpringDataMongo uses this <a href="https://github.com/spring-projects/spring-data-mongodb/blob/3012bcd575d85ad7cd11e07962fc168d4bbc98b2/spring-data-mongodb/src/main/java/org/springframework/data/mongodb/repository/support/SimpleMongoRepository.java#L275-L285" rel="nofollow noreferrer">code</a> internally:</p>
<pre><code>@Override
public &lt;S extends T&gt; Page&lt;S&gt; findAll(final Example&lt;S&gt; example, Pageable pageable) {

    Assert.notNull(example, &quot;Sample must not be null!&quot;);
    Assert.notNull(pageable, &quot;Pageable must not be null!&quot;);

    Query q = new Query(new Criteria().alike(example)).with(pageable);
    List&lt;S&gt; list = mongoOperations.find(q, example.getProbeType(), entityInformation.getCollectionName());

    return PageableExecutionUtils.getPage(list, pageable,
            () -&gt; mongoOperations.count(q, example.getProbeType(), entityInformation.getCollectionName()));
}
</code></pre>
<p>which suggests that <code>list</code> is first being populated with the results and then paging takes place?</p>
<p>If true, how can I achieve efficient big data queries (with paging) without overloading my server? Thanks.</p>

