mongodb group by where field not equals to max<p>I want to get all documents that (grouped by 2 fields) are not equal to their max.</p>
<p>There are multiple versions for every document, so the query to view all the latest versions is:</p>
<pre><code>db.getCollection('datatype').aggregate(
   [
     {
       $group:
         {
           _id: {
               &quot;name&quot;: &quot;$name&quot;,
               &quot;applicationId&quot;: &quot;$applicationId&quot;
               },
           latest: { $max: &quot;$version&quot; }
         }
     }
   ]
)
</code></pre>
<p>Now I need the complement of this query (all previous versions, not the latest).</p>
<p>I tried some queries, like the below, but none worked.</p>
<pre><code>db.getCollection('datatype').aggregate(
   [
     {
       $group:
         {
           _id: {
               &quot;name&quot;: &quot;$name&quot;,
               &quot;applicationId&quot;: &quot;$applicationId&quot;
               },
           previousVersions: 
               { $ne: {$max: &quot;$version&quot;} }

         }
     }
   ]
)
</code></pre>
<p>EDIT:
input/output examples:
input:</p>
<pre><code>db.getCollection('datatype').insertMany([
   { applicationId: &quot;AAAA&quot;, name: &quot;foo&quot;, version: NumberInt(1) },
   { applicationId: &quot;AAAA&quot;, name: &quot;foo&quot;, version: NumberInt(2) },
   { applicationId: &quot;AAAA&quot;, name: &quot;foo&quot;, version: NumberInt(3) },
   { applicationId: &quot;BBBB&quot;, name: &quot;foo&quot;, version: NumberInt(1) },
   { applicationId: &quot;CCCC&quot;, name: &quot;bar&quot;, version: NumberInt(1) },
   { applicationId: &quot;CCCC&quot;, name: &quot;bar&quot;, version: NumberInt(2) }
])
</code></pre>
<p>So the expected results from the first query that takes the latest version from applicationId+name, is:</p>
<pre><code>{ applicationId: &quot;AAAA&quot;, name: &quot;foo&quot;, version: NumberInt(3) },
{ applicationId: &quot;BBBB&quot;, name: &quot;foo&quot;, version: NumberInt(1) },
{ applicationId: &quot;CCCC&quot;, name: &quot;bar&quot;, version: NumberInt(2) }
</code></pre>
<p>And my desired output is basically the complement of this query, that takes all the results besides the latest version (all these documents has an updated version, for their corresponding applicationId+name)</p>
<pre><code>{ applicationId: &quot;AAAA&quot;, name: &quot;foo&quot;, version: NumberInt(1) },
{ applicationId: &quot;AAAA&quot;, name: &quot;foo&quot;, version: NumberInt(2) },
{ applicationId: &quot;CCCC&quot;, name: &quot;bar&quot;, version: NumberInt(1) }
</code></pre>

