</code></pre>
<p>So the expected results from the first query that takes the latest version from applicationId+name, is:</p>
<pre><code>{ applicationId: &quot;AAAA&quot;, name: &quot;foo&quot;, version: NumberInt(3) },
{ applicationId: &quot;BBBB&quot;, name: &quot;foo&quot;, version: NumberInt(1) },
{ applicationId: &quot;CCCC&quot;, name: &quot;bar&quot;, version: NumberInt(2) }
</code></pre>
<p>And my desired output is basically the complement of this query, that takes all the results besides the latest version (all these documents has an updated version, for their corresponding applicationId+name)</p>
<pre><code>{ applicationId: &quot;AAAA&quot;, name: &quot;foo&quot;, version: NumberInt(1) },
